import React  from 'react';   
import Link from 'next/link';
import PropTypes from 'prop-types';
//import { Menu,  Input, Row, Col, Card, Avatar} from 'antd';  
import { makeStyles } from '@material-ui/core/styles';
import { AppBar, Toolbar, Typography, IconButton } from '@material-ui/core';  
import { Paper, Tabs, Tab } from '@material-ui/core'; 
import { Card, Grid, Container } from '@material-ui/core';
 
   
import MenuIcon from '@material-ui/icons/Menu'; 
import UserProfile from './UserProfile';
import { useSelector } from 'react-redux'; 

export function IconLabelTabs() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Paper square className={classes.root}>
      <Tabs
        value={value}
        onChange={handleChange}
        variant="fullWidth"
        indicatorColor="secondary"
        textColor="secondary"
        aria-label="icon label tabs example"
      >
        <Tab icon={<PhoneIcon />} label="RECENTS" />
        <Tab icon={<FavoriteIcon />} label="FAVORITES" />
        <Tab icon={<PersonPinIcon />} label="NEARBY" />
      </Tabs>
    </Paper>
  );
} 



const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,  
    },
    menuButton: {
      marginRight: theme.spacing(2),
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
    }
  }));
const AppLayout = ({ children }) =>{
    const isLoggedIn = useSelector(state=> state.user);
    const classes = useStyles();
 
  
    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
      setValue(newValue);
    };
    
    return (
        <>  
            <AppBar position="static">
                <Toolbar variant="dense">
                    <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
                        <MenuIcon />
                    </IconButton> 
                    <Typography variant="h6" color="inherit">
                        <Link href="/"><a>DigitalGallery</a></Link>
                    </Typography> 
                </Toolbar>
            </AppBar>      
                  
            <Paper className={classes.root} style={{marginBottom:20}}>
                {isLoggedIn ? 
                <Tabs value={value} onChange={handleChange}
                    indicatorColor="primary" textColor="primary" centered="true" 
                >
                    <Tab label={<Link href="/"><a>Home</a></Link>} />
                    <Tab label={<Link href="/myProfile"><a>myProfile</a></Link>} /> 
                </Tabs>
                :   
                <Tabs value={value} onChange={handleChange}
                    indicatorColor="primary" textColor="primary" centered="true" 
                > 
                    <Tab label={<Link href="/"><a>Home</a></Link>} />
                    <Tab label={<Link href="/login"><a>login</a></Link>} />
                    <Tab label={<Link href="/signUp"><a>sign up</a></Link>} />
                </Tabs>
                }
            </Paper> 

            <Container maxWidth="md">
            <Grid container spacing={3}  >
                {isLoggedIn && 
                  <UserProfile />
                }
                <Grid item xs= {isLoggedIn ? 9 : 12}>
                    <Card className={classes.root} style={{padding:20}}>  
                    {children}  
                    </Card>
                </Grid>
            </Grid>
            </Container>
        

               
        </>
    )
}

// AppLayout.prototype = {
//     children: PropTypes.node,
// }

export default AppLayout
